import React, {Component} from 'react';
import {Redirect} from 'react-router-dom';
import './Home.css';


var sectionStyle = {
  width: "100%",
  height: "400px",
  backgroundImage: `url(${Background})`
};
class Home extends React.Component {
  render() {
    return (
      <section style={{ backgroundImage: 'url(require("./banner.jpg"))' }}>
      </section>
    );
  }
}

export default Home;
